import React from 'react';
import { pseudoRandomBytes } from 'crypto';

const content = (props) => {
    return(
        <div class="content">
          <div><img src={props.name}/>        <b> {props.name} </b>   @{props.tweetid}</div>
          <br/>

          <div>{props.content}</div>

        <div><p><img src="Comments Image" alt="Comments"/>
        <img src="Tweet Image" alt="Re Tweet"/>
        <img src="message Image"/> </p></div>
      </div>
    );
}


export default content
